the 90&#39;s. The message went as such: 

&quot;In the course of bygone decades, of thousands of earthly years, beings
interested in the human species meet to decide on the continuation of the
project. You must not imagine that only The Seven implicated in the actual
development of INIT are there. No, it is a coming together of all entities
interested in mankind. 



           &quot;The interests are various. 



           &quot;We, The Seven of the Rainbow People, have decided to help and
support the way chosen by you, in INIT. It is the way of morals, which means
to understand, to acknowledge, to devise, and to act. It is not to be mixed
up with religion, which means to believe. However, the two can be
complementary. But they are independent one from the other.



&quot;You already know that also Pharisees ghouls, swindlers, thieves-yes, even
murderers-have their interested supporters here among the dead. And the term
&quot;higher being&quot;-notice that we never-does not stand, as it is often
misinterpreted by falsely religious people to be purified, rid of all sin,
whatever the word &quot;sin&quot; means for them. There are also entities here
interested in THAT situation.



           &quot;This is the seventh time that we accompany and guide you on your
progress toward a free, wealthy and sane future in which humanity would have
stripped off the chains of intolerance and cruelty-a future in which it will
be able to establish a fruitful, endurable relationship with the Light,
ethereal realms of existence.&quot; 



&quot;Our and your opponents tried to prevent this by all means. Your meeting in
Tarrytown is a decisive one-men and women of wit whittle out together to
make true the dream of a strong international association based on morals
and on ethics, not only by giving it a fundamental constitution and
sheltering it this way from the wind, the rain, and the storms of pernicious
attacks, but also by strengthening love and friendship true, the best
qualities of mankind. 



&quot;The first step was made in Dartington. (In recent) weeks, some of your best
were cruelly hit by illnesses, diseases, and personal problems in order to
keep them away from their valuable work. Be assured, even if we cannot avoid
the plague, we can control the gravity. Whatever has happened, do not lose
courage. We are there. You are in the right way. You are a small number, but
much depends on you and your decisions on those days. We trust in you.&quot;



Frank R.

